2. `popup.html`: This file contains the HTML for the popup that will appear when the user clicks the extension's icon.
3. `popup.js`: This file contains the JavaScript code that will run when the popup is opened.
4. `screenshot.js`: This file contains the JavaScript code that will take the screenshot.

